async function buscar() {
    const NRO_DI = document.getElementById('NRO_DI').value.trim();
    const DSC = document.getElementById('DSC').value.trim();
    const COA = document.getElementById('COA').value.trim();
    const PAIS = document.getElementById('PAIS').value.trim();

    // Validar que los campos no contengan solo puntos o espacios
    if ((NRO_DI && NRO_DI === '.') || 
        (DSC && DSC === '.') || 
        (COA && COA === '.') || 
        (PAIS && PAIS === '.')) {
        alert("Por favor, ingrese valores válidos para la búsqueda.");
        return;
    }

    if ((NRO_DI && NRO_DI === '.') || 
    (DSC && DSC === '.') || 
    (COA && COA === '.') || 
    (PAIS && PAIS === '.')) {
    alert("Por favor, ingrese valores válidos para la búsqueda.");
    return;}

    let queryParams = [];
    if (NRO_DI) queryParams.push(`NRO_DI=${NRO_DI}`);
    if (DSC) queryParams.push(`DSC=${DSC}`);
    if (COA) queryParams.push(`COA=${COA}`);
    if (PAIS) queryParams.push(`PAIS=${PAIS}`);

    if (queryParams.length === 0) {
        alert("Por favor, ingresa al menos un parámetro para la búsqueda.");
        return;
    }

    const queryString = queryParams.join('&');

    let variable = `http://localhost:3001/api/buscar?${queryString}`
    
    try {
        const response = await fetch(variable);
        const data = await response.json();

        if (response.ok) {
            const filteredResults = data.resultados.filter(item => item.EMPRESA === 1);

            document.getElementById('cantidadResultados').innerHTML = 
                `<strong>Se encontró ${filteredResults.length} resultados con los parámetros dados</strong>`;

            // Limpiar resultados anteriores
            const resultadosContainer = document.getElementById('resultados');
            resultadosContainer.innerHTML = '';

            // Vista móvil con cards
            const mobileContainer = document.createElement('div');
            mobileContainer.className = 'd-md-none';
            data.resultados.forEach(item => {
                if(item.EMPRESA === 1){
                const cardTemplate = document.getElementById('template-card').content.cloneNode(true);
                cardTemplate.querySelector('.razon-social').textContent = item.DSC || '-';
                cardTemplate.querySelector('.direccion').textContent = item.DIRECCION || '-';
                cardTemplate.querySelector('.prov').textContent = item.PROV || '-';
                cardTemplate.querySelector('.dep').textContent = item.DPTO || '-';
                cardTemplate.querySelector('.pais').textContent = item.PAIS || '-';
                cardTemplate.querySelector('.ruc-dni').textContent = item.NRO_DI || item.RUC || item.LE || '-';
                cardTemplate.querySelector('.coa').textContent = item.COA || '-';

                const btnDetalles = cardTemplate.querySelector('.btn-primary');
                btnDetalles.addEventListener('click', function() {
                    // Actualizar el modal con los detalles de esta fila
                    document.querySelector('#exampleModal .razon-social').textContent = item.DSC || '-';
                    document.querySelector('#exampleModal .telefono').textContent = item.TELEFONO || item.TELEFONO1 || item.TELEFONO2 || '-';
                    document.querySelector('#exampleModal .email').textContent = item.EMAIL_FE || '-';
                    document.querySelector('#exampleModal .tipo-razon-social').textContent = item.DSC_TC || '-';
                    document.querySelector('#exampleModal .ubigeo').textContent = item.UBG || '-';
                    document.querySelector('#exampleModal .fax').textContent = item.FAX || '-';
                    document.querySelector('#exampleModal .grupo-emp').textContent = item.GRUPOEMP || '-';
                });

                mobileContainer.appendChild(cardTemplate);
                }
            });
            resultadosContainer.appendChild(mobileContainer);

            // Vista desktop con tabla
            const desktopContainer = document.createElement('div');
            desktopContainer.className = 'd-none d-md-block';
            const table = document.createElement('table');
            table.className = 'table table-striped table-hover table-sm';
            table.innerHTML = `
                <thead class="table-primary">
                    <tr>
                        <th>Razón Social</th>
                        <th>Dirección</th>
                        <th>Provincia</th>
                        <th>Departamento</th>
                        <th>País</th>
                        <th>RUC/DNI</th>
                        <th>COA</th>
                        <th>Ver Detalles</th>
                    </tr>
                </thead>
                <tbody></tbody>
            `;
            const tbody = table.querySelector('tbody');
            const seenRUC = new Set();

            data.resultados.forEach(item => {
                if(item.EMPRESA === 1){
                const rowTemplate = document.getElementById('template-tabla').content.cloneNode(true);
                rowTemplate.querySelector('.razon-social').textContent = item.DSC || '-';
                rowTemplate.querySelector('.direccion').textContent = item.DIRECCION || '-';
                rowTemplate.querySelector('.prov').textContent = item.PROV || '-';
                rowTemplate.querySelector('.dep').textContent = item.DPTO || '-';
                rowTemplate.querySelector('.pais').textContent = item.PAIS || '-';
                rowTemplate.querySelector('.ruc-dni').textContent = item.NRO_DI || item.RUC || '-';
                rowTemplate.querySelector('.coa').textContent = item.COA || '-';

                const btnDetalles = rowTemplate.querySelector('.btn-primary');
                btnDetalles.addEventListener('click', function() {
                    // Actualizar el modal con los detalles de esta fila
                    document.querySelector('#exampleModal .razon-social').textContent = item.DSC || '-';
                    document.querySelector('#exampleModal .telefono').textContent = item.TELEFONO || item.TELEFONO1 || item.TELEFONO2 || '-';
                    document.querySelector('#exampleModal .email').textContent = item.EMAIL_FE || '-';
                    document.querySelector('#exampleModal .tipo-razon-social').textContent = item.DSC_TC || '-';
                    document.querySelector('#exampleModal .ubigeo').textContent = item.UBG || '-';
                    document.querySelector('#exampleModal .fax').textContent = item.FAX || '-';
                    document.querySelector('#exampleModal .grupo-emp').textContent = item.GRUPOEMP || '-';
                    document.querySelector('#exampleModal .cargo-mn').textContent = item.CARGO_INFO?.[0]?.CARGO_MN || '-';
                });
                

                tbody.appendChild(rowTemplate);
                seenRUC.add(item.RUC);
                }
                
            });
            desktopContainer.appendChild(table);
            resultadosContainer.appendChild(desktopContainer);
        } else {
            document.getElementById('cantidadResultados').innerHTML = '';
            document.getElementById('resultados').innerHTML = 
                data.message || 'No se encontraron resultados con los parámetros dados';
        }
    } catch (error) {
        console.error('Error de búsqueda:', error);
        alert('Hubo un error en la búsqueda, por favor inténtalo nuevamente.');
    }
}

